import "./styles.css";
import React from "react";
import CardItem from "../CardItem/CardItem";

function Cards() {
  return (
    <div className="cards">
      <h1>Check out there EPIC Destination !</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
            <CardItem
              src="https://d3t32hsnjxo7q6.cloudfront.net/i/991799d3e70b8856686979f8ff6dcfe0_ra,w158,h184_pa,w158,h184.png"
              text="Maybelline Face Studio Master Hi-Light Light Booster Bronzer"
              label="NEW"
              path="/services"
            />
            <CardItem
              src="https://d3t32hsnjxo7q6.cloudfront.net/i/991799d3e70b8856686979f8ff6dcfe0_ra,w158,h184_pa,w158,h184.png"
              text="Maybelline Face Studio Master Hi-Light Light Booster Bronzer"
              label="NEW"
              path="/services"
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
